import styled from "styled-components";

const FooterListContent = [
  {
    id: 1,
    title: "Support",
    content: [
      {
        id: 1,
        text: "111 Bijoy sarani, Dhaka,  DH 1515, Bangladesh.",
      },
      {
        id: 2,
        text: "exclusive@gmail.com",
      },
      {
        id: 3,
        text: "+88015-88888-9999",
      },
    ],
  },
  {
    id: 2,
    title: "Support",
    content: [
      {
        id: 1,
        text: "111 Bijoy sarani, Dhaka,  DH 1515, Bangladesh.",
      },
      {
        id: 2,
        text: "exclusive@gmail.com",
      },
      {
        id: 3,
        text: "+88015-88888-9999",
      },
    ],
  },
  {
    id: 3,
    title: "Support",
    content: [
      {
        id: 1,
        text: "111 Bijoy sarani, Dhaka,  DH 1515, Bangladesh.",
      },
      {
        id: 2,
        text: "exclusive@gmail.com",
      },
      {
        id: 3,
        text: "+88015-88888-9999",
      },
    ],
  },
];
export default function Footer() {
  return (
    <FooterContainer>
      <FooterListContainer>
        <FooterListFirst>
          <h1>Exclusive</h1>
          <h2>Subscribe</h2>
          <p>Get 10% off your first order</p>
          <input placeholder="Enter your email" type="email" />
        </FooterListFirst>
        <FooterList>
          <FooterListTitle>Company</FooterListTitle>
          <FooterListLink href="/">About Us</FooterListLink>
          <FooterListLink href="/">Blog</FooterListLink>
          <FooterListLink href="/">Contact</FooterListLink>
        </FooterList>
        <FooterList>
          <FooterListTitle>Company</FooterListTitle>
          <FooterListLink href="/">About Us</FooterListLink>
          <FooterListLink href="/">Blog</FooterListLink>
          <FooterListLink href="/">Contact</FooterListLink>
        </FooterList>
        <FooterList>
          <FooterListTitle>Company</FooterListTitle>
          <FooterListLink href="/">About Us</FooterListLink>
          <FooterListLink href="/">Blog</FooterListLink>
          <FooterListLink href="/">Contact</FooterListLink>
        </FooterList>
        <FooterListLast></FooterListLast>
      </FooterListContainer>
    </FooterContainer>
  );
}

const FooterContainer = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  width: 100%;
  border-top: 1px solid #000;
  background-color: #000;
  color: #fff;
  font-size: 12px;
  padding: 20px 0;
`;

const FooterListContainer = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: center;
  width: 100%;
  padding: 20px 0;
`;
const FooterListFirst = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: flex-start;
  padding: 0;
  margin: 0;
  width: 100%;
  h1 {
    font-size: 24px;
    font-weight: 700;
    margin-bottom: 20px;
  }
  h2 {
    font-size: 20px;
    font-weight: 700;
    margin: 0;
    margin-bottom: 16px;
  }
  p {
    font-size: 14px;
    color: #fff;
    margin: 0;
    margin-bottom: 16px;
  }
  input {
    width: 100%;
    padding: 12px;
    border-radius: 5px;
    border: 1px solid #fff;
    background-color: #000;
    color: #fff;
    margin-bottom: 20px;
    font-size: 14px;
    &:focus {
      outline: none;
    }
  }
`;
const FooterList = styled.ul`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: flex-start;
  padding: 0;
  margin: 0;
  width: 100%;
  list-style: none;
`;

const FooterListTitle = styled.li`
  font-size: 20px;
  font-weight: 500;
  margin-bottom: 20px;
`;

const FooterListLink = styled.a`
  font-size: 14px;
  color: #fff;
  width: 175px;
  text-decoration: none;
  margin-bottom: 12px;
  &:hover {
    text-decoration: underline;
  }
`;

const FooterListText = styled.li`
  font-size: 14px;
  color: #fff;
  text-decoration: none;
  margin-bottom: 10px;
`;

const FooterListLast = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: flex-start;
  padding: 0;
  margin: 0;
  width: 100%;
`;
